import React from 'react';
import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';

function Home() {
  return (
    <div>
      <BrowserRouter>
        <header>
          <Link>안녕</Link>
        </header>
      </BrowserRouter>
      <Routes>
        <Route></Route>
      </Routes>
    </div>
  );
}

export default Home;
